import { makeStyles } from 'tss-react/mui';
import { Grid2 } from '@mui/material';


const useStyles = makeStyles()((theme) => ({
    container: {
        background: "red",
        maxHeight: "100%",
        maxWidth: "100%"
    },
    item: {
        backgroundColor: "red",
        height: "100%",
        width: "100%"
    },
    // button: {
    //   backgroundColor: theme.palette.primary.main,
    //   color: theme.palette.primary.contrastText,
    //   '&:hover': {
    //     backgroundColor: theme.palette.primary.dark,
    //   },
    // },
}));


function DisplayScreen() {
    const { classes } = useStyles();

    return (
        <Grid2 style={{ background: "yellow", justifyItems: "center", height: "100%", width: "100%" }}>
            <Grid2 style={{ background: "red", direction: "column", alignContent: "center", height: "600px", width: "600px", justifyItems: "center" }}>
                <Grid2>
                    <DisplayHeader />
                </Grid2>
                <Grid2>
                    <DisplayScreen />
                </Grid2>
            </Grid2>
        </Grid2>
    );
}

export default DisplayScreen;
